	('4fd73125-0168-4728-858c-f906dc2127f3', '2022-12-13 01:25:54.965341', '2022-12-13 01:25:54.965341', 'CR-082', true, 'The hotel was solidly built in three phases; The front half was constructed in 1996, the back half in 2001, and the pool and patio area, in 2010. All existing 34 smoke-free hotel rooms are quite modern and spacious and are fully loaded, each with two large beds, clean, cool ceramic-tiled floors, private baths (some with bidets), all with large color TV''s, & wireless internet runs throughout the hotel.  All rooms have A/C, direct dial phones with free international and local calls, coffee makers, a small writing table and chairs, a closet and dresser, and an in-room safe. There are three suites which have in-bath Jacuzzis, microwaves and a small fridge.  There is a sixty person bar and restaurant, and a big two story solarium room with a large Mayan waterfall aquarium, a solar-heated Jacuzzi beside the new pool, a computer station with four computers for people without a laptop, and a new fully equipped gym.  The location is multi-purpose. It is ideal for first and last night stays in Costa Rica for tourists and condo owners, as well as being conveniently located directly across the street from the New Convention Center.', 'Adventure Inn Hotel', '{"lat": "9.97356", "lng": "-84.150973"}', 'Commercial', 1923, 1996, 3800, '2 Story', 0, 37, 43, 0, 0, '[]', 2700000, 0, 0, 3000, 'joaquin@remax-dreamliving-cr.com', '8978-8585', 'Joaquin Duenas Carrillo', '["Sale"]', 'b414c935-fd4b-4f02-9663-a760e8d9c50a'),
	('a36b99ac-b949-4b74-bb84-b92e3135dfe0', '2022-12-09 02:45:13.377964', '2022-12-09 02:45:13.377964', 'CR-012', true, 'This is a very attractive one storey home with plenty of backyard and interior space. The dwelling consists of three comfortable-sized bedrooms and two and a half bathrooms. There is also a maid’s quarters with its own pretty bathroom that could well serve as guest quarters. As well are a two-car garage, spacious laundry area, a second entrance into the backyard for service people (e.g. gardener), high ceilings with nice wood beams, automatic sprinkler system for the back and front yards, and a large patio overlooking the backyard. You also have access to the backyard via the French doors from the master bedroom. This property is located close to the entrance of a gated community called Bosques de Doña Rosa which is a very safe and beautiful area of Cariari. The private Cariari Golf and Country club with its Tom Fazio designed golf course, 12 tennis courts, Olympic swimming pool, exercise, and fitness center is but a short distance away.', 'Avenida 70, Provincia Heredia, La Asunción, 40703', '{"lat": "9.971732", "lng": "-84.16488"}', 'Residential', 840, 1995, 311, '', 0, 3, 2, 0, 2, '[]', 395000, 0, 70, 0, '', '8834-4515', 'Godutch Realty', '["Sale"]', 'b414c935-fd4b-4f02-9663-a760e8d9c50a'),
	('e97e8f20-3de8-489d-b054-7a372dcd34c3', '2025-07-22 00:35:01.071462', '2025-07-22 00:35:01.071462', 'CR-119', true, 'Excellent Cariari Commercial Center for sale. Attractive property located in a plus-value zone in Cariari. Situated in a strategical zone parallel to the main highway that leads from San Jose to the airport. Also it is a block away from the Cariari Golf and Country Club and near the new Convention Center.
